DROP TABLE IF EXISTS `TextObjectAttribute`;
CREATE TABLE `TextObjectAttribute` (
  `textobjectattributeId` bigint(21) NOT NULL AUTO_INCREMENT,
  `textobjectattributeTextObjectRef` bigint(21) DEFAULT '-1',
  `textobjectattributeUserRef` bigint(21) DEFAULT '-1',
  `textobjectattributeName` varchar(255) DEFAULT NULL COMMENT 'Owner/Collaborater/Freerider [read+write+rulesetter/read+write/read]',
  `textobjectattributeCreate` datetime DEFAULT NULL COMMENT 'Stores Preferences/UserPrefs (Hide) etc. ',
  PRIMARY KEY (`textobjectattributeId`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

-- ----------------------------
--  Table structure for `TextObjectVersion`
-- ----------------------------
DROP TABLE IF EXISTS `TextObjectVersion`;
CREATE TABLE `TextObjectVersion` (
  `textobjectId` bigint(20) NOT NULL,
  `textobjectVersionId` bigint(32) NOT NULL AUTO_INCREMENT COMMENT 'Version Id',
  `textobjectVersionType` varchar(255) DEFAULT NULL COMMENT 'Version type',
  `textobjectVersionUserRef` bigint(32) DEFAULT '-1' COMMENT 'User Ref',
  `textobjectRefName` varchar(255) DEFAULT NULL COMMENT 'Reference Name used for TextObjectMembers',
  `textobjectRef` bigint(20) DEFAULT '-1' COMMENT 'Reference to other TextObject',
  `textobjectUserRef` bigint(20) DEFAULT '-1' COMMENT 'Reference User Ref',
  `textobjectOrder` bigint(20) DEFAULT '-1' COMMENT 'Order for the comments',
  `textobjectTimeA` float DEFAULT '-1' COMMENT 'Reference Time Start',
  `textobjectTimeB` float DEFAULT '-1' COMMENT 'Reference Time Stop',
  `textobjectTimeAction` varchar(255) DEFAULT NULL COMMENT ' | Stop | ',
  `textobjectCommentType` varchar(255) DEFAULT NULL COMMENT ' | visual | text',
  `textobjectPositionX` int(20) DEFAULT '-1' COMMENT 'ReferencePosition Visual X',
  `textobjectPositionY` int(20) DEFAULT '-1' COMMENT 'ReferencePosition Visual Y',
  `textobjectPositionZ` int(20) DEFAULT '-1' COMMENT 'ReferencePosition Visual Z',
  `textobjectCursorA` int(11) DEFAULT '-1' COMMENT 'Reference Cursor A',
  `textobjectCursorB` int(11) DEFAULT '-1' COMMENT 'Reference Cursor B',
  `textobjectStatus` varchar(255) DEFAULT NULL COMMENT 'Status draft|published|delete',
  `textobjectName` varchar(255) DEFAULT NULL,
  `textobjectType` varchar(255) DEFAULT NULL COMMENT 'MimeType',
  `textobjectTypeSub` varchar(255) DEFAULT NULL COMMENT 'MimeTypeSub',
  `textobjectDefinition` varchar(255) DEFAULT NULL COMMENT 'not used … ',
  `textobjectArgumentText` text,
  `textobjectArgumentFloat` float(16,0) DEFAULT NULL,
  `textobjectArgumentInt` int(16) DEFAULT NULL,
  `textobjectArgumentDate` datetime DEFAULT NULL,
  `textobjectWidth` varchar(255) DEFAULT '',
  `textobjectHeight` varchar(255) DEFAULT NULL,
  `textobjectTimeLength` float DEFAULT '-1' COMMENT 'Reference Time Start',
  `textobjectCreate` datetime DEFAULT NULL,
  `textobjectUpdate` datetime DEFAULT NULL,
  `textobjectUpdateComments` datetime DEFAULT NULL COMMENT 'Last Update on Commands ...',
  PRIMARY KEY (`textobjectVersionId`),
  KEY `textobjectRefName` (`textobjectRefName`),
  KEY `textobjectRef` (`textobjectRefName`),
  KEY `textobjectStatus` (`textobjectStatus`) USING BTREE,
  KEY `textobjectType` (`textobjectType`) USING HASH,
  KEY `textobjectTypeSub` (`textobjectTypeSub`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=2437 DEFAULT CHARSET=utf8;

