-13 23:19:27', null), ('2746', '2326', 'insert', '3489', '', '2733', '-1', '-1', '-1', '-1', null, '', '50', '50', '-1', '-1', '-1', 'published', '', 'text', 'rtf', null, '<address style=\"margin: 0px; padding: 0px 0px 11px; border: 0px; font: inherit; vertical-align: baseline; outline: 0px; font-family: Georgia, serif; color: #1e1e1e; line-height: 1.467em; background-color: #f2f2f2;\"><span style=\"margin: 0px; padding: 0px; border: 0px; font-size: 15px; font: inherit; vertical-align: baseline; outline: 0px;\">Manfred Rist, Paris</span></address>\n<div id=\"articleBodyText\" style=\"margin: 0px; padding: 0px 31px 0px 0px; border: 0px; font: inherit; vertical-align: baseline; outline: 0px; clear: none; line-height: 1.5em; font-family: Georgia, serif; color: #1e1e1e; background-color: #f2f2f2;\">\n<div style=\"margin: 0px; padding: 0px; border: 0px; font-size: 16px; font: inherit; vertical-align: baseline; outline: 0px; clear: none;\">\n<p style=\"margin: 0px 0px 21px; padding: 0px; border: 0px; font-size: 16px; font: inherit; vertical-align: baseline; outline: 0px;\">Dass Frankreich an der geografischen Taille Malis, die den S&uuml;den und die Hauptstadt Bamako vom mittlerweile islamistisch beherrschten Norden Malis trennt, eine Linie im Sand gezogen und am Freitag milit&auml;risch rasch reagiert hat, hat die innenpolitische Stellung von Pr&auml;sident Hollande ziemlich ver&auml;ndert. Der bis anhin als z&ouml;gerlich und abtastend geltende Staatschef scheint eine Zuspitzung der Lage im westafrikanischen Land erwartet und sich gut vorbereitet zu haben. Von wenigen Ausnahmen abgesehen, gibt es kaum kritische Stimmen in Frankreich. Im R&uuml;ckblick f&auml;llt auf, dass Hollande in seinen Erkl&auml;rungen immer wieder vor islamistischen Extremisten im Sahel gewarnt hat.</p>\n</div>\n</div>', null, null, null, '', null, '-1', '2013-01-13 23:25:27', '2013-01-13 23:25:27', null), ('2746', '2327', 'update', '3489', '', '2733', '-1', '-1', '-1', '-1', null, '', '50', '50',